void __memcpy() {
    union cell *dst = ffi_ptr[-2].p, *src = ffi_ptr[-1].p;
    long long int n = ffi_ptr[0].i;
	ffi_ptr -= 3;
    memcpy(dst, src, n * sizeof(union cell));
}

void __memrev() {
    union cell *dst = ffi_ptr[-1].p, tmp;
    long long int n = ffi_ptr[0].i;
    ffi_ptr -= 2;
    size_t i, j;
    for (i = 0, j = n - 1; i < j; i++, j--) {
        tmp = dst[i];
        dst[i] = dst[j];
        dst[j] = tmp;
    }
}

void __memset() {
    union cell *dst = ffi_ptr[-2].p, v = ffi_ptr[-1];
    long long int n = ffi_ptr[0].i;
    for (int i = 0; i < n; i++) {
        dst[i] = v;
    }
	ffi_ptr -= 3;
    // memset(dst, v, n * sizeof(union cell));
}

void __strncpy() {
    union cell *dst = ffi_ptr[-2].p, *src = ffi_ptr[-1].p;
    long long int n = ffi_ptr[0].i;
	ffi_ptr -= 3;
    for (int i = 0; i < n; i++) {
        if (src[i].i == 0) {
            dst[i].i = 0;
            return;
        }
        dst[i] = src[i];
    }
	dst[n].i = 0;
}

void __strncat() {
    union cell *dst = ffi_ptr[-2].p, *src = ffi_ptr[-1].p;
    long long int n = ffi_ptr[0].i;
	ffi_ptr -= 3;
	for (; dst->i; dst++);
	for (int i = 0; i < n; i++) {
		if (src[i].i == 0) {
			dst[i].i = 0;
			return;
		}
		dst[i] = src[i];
	}
	dst[n].i = 0;
}

void __strcmp() {
    union cell *dst = ffi_ptr[-2].p, *src = ffi_ptr[-1].p;
    long long int n = ffi_ptr[0].i;
    for (int i = 0; i < n; i++) {
        if (dst[i].i != src[i].i) {
            ffi_ptr[-2].i = dst[i].i - src[i].i;
			ffi_ptr -= 2;
            return;
        }
    }
    ffi_ptr[-2].i = 0;
	ffi_ptr -= 2;
}

void __strlen() {
    union cell *src = ffi_ptr[0].p;
	for (ffi_ptr[0].i = 0; src[ffi_ptr[0].i].i; ffi_ptr[0].i++);
}

